function Predictor() {
    const [formData, setFormData] = useState({
      DepTimeMinutes: 0,
      CRSArrTimeMinutes: 0,
      TaxiIn: 0.0,
      TaxiOut: 0.0,
      CarrierDelay: 0.0,
      WeatherDelay: 0.0,
      NASDelay: 0.0,
      LateAircraftDelay: 0.0,
    });
  
    const [result, setResult] = useState(null);
  
    const handleChange = (e) => {
      setFormData({ ...formData, [e.target.name]: parseFloat(e.target.value) });
    };
  
    const handleSubmit = async (e) => {
      e.preventDefault();
      try {
        const response = await axios.post('http://localhost:8000/predict', formData);
        setResult(response.data);
      } catch (error) {
        console.error("Prediction error:", error);
      }
    };
  
    return (
      <div className="form-container">
        <h1 className="form-title">Flight Delay Prediction</h1>
        <form onSubmit={handleSubmit}>
          <div className="input-row">
            <div className="input-group">
              <label>Dep Time (Minutes)</label>
              <input type="number" name="DepTimeMinutes" onChange={handleChange} />
            </div>
            <div className="input-group">
              <label>CRS Arr Time (Minutes)</label>
              <input type="number" name="CRSArrTimeMinutes" onChange={handleChange} />
            </div>
          </div>
          <div className="input-row">
            <div className="input-group">
              <label>Taxi In</label>
              <input type="number" name="TaxiIn" onChange={handleChange} />
            </div>
            <div className="input-group">
              <label>Taxi Out</label>
              <input type="number" name="TaxiOut" onChange={handleChange} />
            </div>
          </div>
          <div className="input-row">
            <div className="input-group">
              <label>Carrier Delay</label>
              <input type="number" name="CarrierDelay" onChange={handleChange} />
            </div>
            <div className="input-group">
              <label>Weather Delay</label>
              <input type="number" name="WeatherDelay" onChange={handleChange} />
            </div>
          </div>
          <div className="input-row">
            <div className="input-group">
              <label>NAS Delay</label>
              <input type="number" name="NASDelay" onChange={handleChange} />
            </div>
            <div className="input-group">
              <label>Late Aircraft Delay</label>
              <input type="number" name="LateAircraftDelay" onChange={handleChange} />
            </div>
          </div>
          <button className="submit-button" type="submit">Predict Delay</button>
        </form>
  
        {result && (
          <div>
            <h2>Prediction Result:</h2>
            <p>Prediction: {result.prediction}</p>
            <p>Probability of Delay: {result.probability_of_delay}</p>
            <Link to="/visuals">
              <button className="submit-button" style={{ marginTop: '20px' }}>Show Visuals</button>
            </Link>
          </div>
        )}
      </div>
    );
  }
  
  export default Predictor;
